edit ONSAVING.txt if you are reading this, you may want to know how to save your file system! Well it's quite simple. Go to your inspect element console and type the following command. 

JSON.stringify(Console.fileSystem);

This will print out a string. Copy this and save it. In the future, to load this string, just type this command. 

Console.fileSystem = `your string`;

